const initGetProduct = {
    getProduct:[]
}

export function getProduct (state = initGetProduct, action) {
    switch(action.type){
        case 'GET_PRODUCT_DATA': 
            return {...state.getProduct, getProduct:[...action.payload.value]}
            default: 
            return state
    }
}
